102.body:
La función $jsonArraySort ordena un array JSON específico en orden ascendente. La función ordena los elementos en el siguiente orden: Números enteros de menor a mayor. Cadenas de texto basadas en sus valores ASCII/Unicode. Sintaxis $jsonArraySort[Key;...] Parámetros key (Tipo: String || Opcional) La clave del array JSON que se ordenará. Ejemplo $jsonParse[{ 'data': ['Oranges', 'banana', 10, 'apple', 'Apples', 2, 30]
}] $jsonArraySort[data] Después de ordenar:
> $json[data] alt text Para obtener más información, consulte la Guía de JSON Funciones .

103.body:
La función $jsonArrayReverse invierte el orden de un array JSON específico. Sintaxis $jsonArrayReverse[Key;...] Parámetros key (Tipo: String || Opcional) La clave del array JSON que se invertirá. Ejemplo $jsonParse[{ 'fruits': ['apple', 'orange', 'banana', 'grape']
}] $jsonArrayReverse[fruits] Después de invertir:
> $json[fruits] alt text Para obtener más información, consulte la Guía de JSON Funciones .

104.body:
La función $jsonJoinArray une un array JSON bajo la clave especificada utilizando el separador dado. La función $jsonJoinArray devolverá una cadena vacía si el valor es null, la clave no existe, no se ejecutaron las funciones $jsonParse o $jsonSet, o si se ejecutó $jsonClear. Sintaxis $jsonJoinArray[Key;...;Separator] Parámetros Key (Tipo: String || Flag: Required): La clave JSON que apunta a un array que será recuperado. Separator (Tipo: String || Flag: Required): El separador que se utilizará para unir los elementos del array. Ejemplo $jsonParse[{ 'music': ['Paranoid - MADKID', 'Ping! 2 - Exyl', 'Tokyo - Leat\'eq']
}] Music:
> $jsonJoinArray[music;, ] alt text Para obtener más información, consulte la Guía de JSON Funciones .

83.body:
La función $jsonExists verifica si una clave JSON especificada existe en el objeto JSON actual. Devuelve un resultado vacío si no se ejecutaron las funciones $jsonParse o $jsonSet, o si se ejecutó $jsonClear. Sintaxis $jsonExists[Key;...] Parámetros Key (Tipo: String || Flag: Required): La clave JSON que se verificará. Ejemplo $jsonParse[{ 'user': { 'name': 'Amisadai', 'age': 20 }
}] $jsonExists[user;name] ✅ La clave 'name' existe.
$jsonExists[user;email] ❌ La clave 'email' no existe. alt text Para obtener más información, consulte la Guía de JSON Funciones .

